import styled from 'styled-components';

const FTContainer = styled.main`
  background-color: var(--gray);
  color: white;
  display: flex;
  justify-content: center;
  margin-top: 100px;
  height: 100%;
`;

const FreeTags = () => <FTContainer>FreeTags</FTContainer>;

export default FreeTags;
